import CreateStudent from "./Forms/CreateStudent";

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>Ethereum and IPFS using Infura</h1>
        </header>
        <CreateStudent name={'Dimitar'}/>
      </div>
    );
  }
}
export default App;
